import Sidebar from '../../components/sidebar/Sidebar'
import Navsection from '../../components/navbar/Navsection'
import './chapter3.scss'
import { useNavigate } from "react-router-dom"
import  SyntaxHighlighter  from 'react-syntax-highlighter';
import {far} from 'react-syntax-highlighter/dist/esm/styles/hljs';
const Chapter3 = () => {
    const obj1 = 
    ` public class Main {
        static void aMethod() {
          System.out.println("A Java Tutor!");
        }
        public static void main(String[] args) {
          myMethod();
        }
}`
const obj2 = 
` public class Main {
    static void aMethod(String name, int age) {
        System.out.println(name + " is " + age+ "years Old!");
    }
    public static void main(String[] args) {
        aMethod("Xin", 5);
        aMethod("Hao", 8);}
    }
}
    output: Xin is 5 years Old!;Hao is 8 years Old!

`

const inputdefault  = 
  `
  int myMethod(int a) {
    return a;
   }
  System.out.print(myMethod())
  ` 

